#575
def distributeCandies( candies):
    limit = len(candies)/2

    sister_candies = []
    count = 0
    for candy in candies:
        if (len(sister_candies)>= limit):


            break
        if(candy not in sister_candies):

            sister_candies.append(candy)
        count +=1


    return len(sister_candies)
